import React from 'react';
import { Route } from "react-router-dom";
import './Prison.css'
import PrisonOverview from './PrisonOverview'

const Prison = props => {
    return (
        <div className="prison-wrapper" onClick={() => props.getPrisonInfo(props.prison.id)}>
            <h3>Name: {props.prison.name}</h3>
            <p>ZIP Code: {props.prison.location}</p>
            <p>Phone: {props.prison.phoneNumber}</p>
            <p>Available Workers: {props.prison.totalPrisoners}</p>
        </div>
    )
};

export default Prison;
